import logo from '../../images/logo/Vector.svg'

export default function Header() {
  return (
    <header className="header">
      <img
      className="header__logo"
      src={logo}
      alt="логотип Mesto"
      />
      <div className='header'>

      </div>
    </header>
  )
}
